column8:
お肌の弱い赤ちゃんにも使える、健康な肌と同じ弱酸性タイプです。<br>球状サラサラパウダー入りで、きめ細かくやさしいパウダーです。<br>あせもやおむつかぶれ、ただれを防ぐ薬用パウダーです。<br>スクワラン・ホホバオイル(保湿成分)・シリコーンオイル(皮フ保護剤)配合。<br>イエローパフつき。<br>ケースは中栓つきで、軽くふるだけで適量のパウダーがパフにつきます。<br>医薬部外品。<table width="800" border="0" cellspacing="0" cellpadding="0">

